import APIHandler from './APIHandler.js';

class APIShipment extends APIHandler{
    
    async findShipmentByTrackingCode(_trackingCode){
        try {
            const data = await this.getRequest("http://54.146.196.79:8080/dp1/api/dispatch/tracking?code="+_trackingCode);
            return data;
        } catch (error) {
            console.error(error);
        }
    }   
    async listShipments(_id){
        try {
            const data = await this.getRequest(
              "http://54.146.196.79:8080/dp1/api/dispatch/findby/airport?code=" +
                _id
            );
            return data;
          } catch (error) {
            console.error(error);
        }      
    }
    async saveShipment(_status,_late,_send_client,_receive_client,_originAirport,_pack){
        try {
            const data = await this.postRequest("http://54.146.196.79:8080/dp1/api/dispatch/save", {"status":_status,"late":_late,"send_client":_send_client,"receive_client":_receive_client,"originAirport":_originAirport,"pack":_pack});
            return data;
        } catch (error) {
            console.error(error);
        }
    }

    async finishShipmentNow( _trackingCode,_status){
        try {
            const data = await this.postRequest("http://54.146.196.79:8080/dp1/api/dispatch/update/status?", {"trackingCode":_trackingCode,"status":_status});
            return data;
        } catch (error) {
            console.error(error);
        }
    }


}
export default APIShipment;
